¡Gracias por formar parte de nosotros y compartir tus mejores momentos en #PuertoVallarta!

Hoy en el #DíaMundialdelaFotografía nos sentimos agradecidos por formar parte de tus recuerdos y te invitamos a seguir contando la historia de #PuertoVallarta a través de tus fotografías con los hashtags #PuertoVallarta y #RevivePuertoVallarta.

Te compartimos el top 5 de las fotografías más increíbles realizadas por los fotógrafos destacados de #PuertoVallarta. 
.

Thank you for being a part of us, and sharing your best moments in #PuertoVallarta!

Today, as we celebrate #WorldPhotographyDay we feel grateful for being a part of your memories and we invite you to keep telling the story of #PuertoVallarta through your snapshots, using the hashtags #PuertoVallarta and #RevivePuertoVallarta.

Here are the Top 5 best pictures authored by renown photographers in #PuertoVallarta. 

