La playa de Los Muertos es una de las favoritas tanto de locales y visitantes, pues además de que es de muy fácil acceso, es ideal para observar los mágicos atardeceres de #PuertoVallarta desde su icónico muelle. 

#RevivePuertoVallarta

@steveglwalsh 

Los Muertos beach is one of the favorites of both locals and visitors, because in addition to being very easy to access, it is ideal for watching the magical sunsets of #PuertoVallarta from its iconic pier.

#RevivePuertoVallarta

@steveglwalsh

Etiqueta en este post a esa persona con la que quisieras disfrutar de un atardecer en #PuertoVallarta. 

