La Zona Romántica de #PuertoVallarta es perfecta para dar largos paseos al atardecer. En cada calle podrás encontrar divinas vistas hacia el mar. 

@juanogaribay 

The Romantic Zone of #PuertoVallarta is perfect for taking long walks at sunset. In every street you can find divine views towards the sea.

